(() => {
  function solve(input) {
    var lines = Utils.read(input);

    var state = {
      code: "",
      pos: 5
    };

    for (var i = 0; i < lines.length; i++) {
      var steps = lines[i].split("");
      for (var j = 0; j < steps.length; j++) {
        move(state, steps[j]);
      }
      state.code += state.pos;
    }

    return state.code;
  }

  function move(state, step) {
    switch (step) {
      case "U":
        if (state.pos > 3) {
          state.pos -= 3;
        }
        break;
      case "R":
        if (state.pos % 3 != 0) {
          state.pos++;
        }
        break;
      case "D":
        if (state.pos < 7) {
          state.pos += 3;
        }
        break;
      case "L":
        if (state.pos % 3 != 1) {
          state.pos--;
        }
        break;
    }
  }

  var dataset = [];

  dataset.push({
    input: `ULL
RRDDD
LURDL
UUUUD`,
    output: 1985
  });

  dataset.push({
    input: `



`,
    output: 44558
  });

  Utils.check(solve, dataset, "2a");
})();
